import React from 'react';
import axios from 'axios';

function httpcall(){
  axios.get("http://localhost:8080/todo").then(function(res){
    console.log(res.data.errors);
  });
}

function App() {
  httpcall();
  return (
    <div className="App">
      <h1>Hello</h1>
    </div>
  );
}

export default App;
